import styled from 'styled-components';
import { Link as LinkRouter } from 'react-router-dom';

export const Container = styled.div`
    margin-top: 130px;
    height: 120vh;
    width: 100vw;
    background: green;
`

export const Project = styled.div`
    /* position: fixed; */
    width: 20%;
    scroll-margin-top: 130px;
    height: 20%;
    left 40%;
    top: 40%;
    background: pink;
    padding: 24px;
`
